import { MaterialCommunityIcons } from '@expo/vector-icons';
import * as React from 'react';
import { StyleSheet, TextInput } from 'react-native';
import { Text, View } from '../components/Themed';

export default function TabOneScreen() {
  return (
    <View>
      <Text style={styles.title}>Lista de Tareas</Text>

    <view style={{flexDirection:"row"}}>
      {/*Checkbox*/}
      <MaterialCommunityIcons style={{marginHorizontal:"25%"}} name="checkbox-blank-outline" size={24} color="black" />


      {/*TextInput*/}
      <TextInput
        style={{
          flex:1,
          backgroundColor:"#282828",
          color:"white",
          fontSize:18,
          marginVertical:25,
          width:'50%',
          marginHorizontal:"25%"
        }}>
      </TextInput>
    </view>


    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 2,
    alignItems: 'center',
    padding: 12,
  },
  title: {
    fontSize: 20,
    fontWeight: 'bold',
    alignItems: 'center',
    padding: 5,
    marginHorizontal:"25%"
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: '100%',
  },
});
